import {Link} from "react-router-dom";
import useRedirection from "../hooks/useRedirection";

function Landing() {

    useRedirection("/articulos", 3000); // Redireccionamos a la vista de restaurantes en 3 segundos

    return (
        <div className="landing">
                <Link to={"/articulos"}> {/* Añadimos un enlace a la vista de restaurantes */}
                    <h1>Bienvenidos a Nuestro Delivery</h1>
                </Link>
                <span ></span> {/* Puntero láser original */}
                <span ></span> {/* Nuevo puntero láser en sentido contrario */}
        </div>
    );
}

export default Landing;
